Comment.create!([
  {post_id: 15, user_id: 2, text: "That sounds great. I'm free either date. Let me know what I can bring."},
  {post_id: 15, user_id: 29, text: "Great idea, Darnell! The 29th is better for me, but don't plan around me if more folks can do the 22nd."},
  {post_id: 15, user_id: 32, text: "Since you're the one doing the grilling, I'm in :)"},
  {post_id: 15, user_id: 7, text: "YES."},
  {post_id: 18, user_id: 33, text: "Atotonilco makes a killer al pastor taco for only $2.50 a pop. Kinda makes you feel sorry for the people who pay $6 for a taco at Antique Taco in Wicker :)"},
  {post_id: 18, user_id: 1, text: "Love both of those places, Hugh... The U.S. Pizza Cup Winner at Paulie Gee's is one of my favorite pizzas. It's technically Detroit-style, but it's SO good."},
  {post_id: 17, user_id: 6, text: "Ghosts in the Schoolyard\nThe Battle of Lincoln Park\nKevin Coval's poetry (A People's History & Everything Must Go)"},
  {post_id: 17, user_id: 30, text: "The Color of Law by Richard Rothstein"},
  {post_id: 17, user_id: 33, text: "José Olivarez's Citizen Illegal."},
  {post_id: 17, user_id: 31, text: "There Are No Children Here. And everything Robert said."},
  {post_id: 19, user_id: 25, text: "Personally, I loved the idea of getting to know not only my more immediate neighbors around my block, but also getting to know people from across the city. Admittedly, I haven't been to the South Side often, and when I have, it's usually just passing through or doing a quick errand."},
  {post_id: 19, user_id: 31, text: "Segregation in this city is so deeply rooted that it's hard to know where to start. It runs so much deeper than interpersonal relationships, but I suspect that the lack of interpersonal relationships is a major barrier to any sort of meaningful progressive change.\n\nI want people to truly know my neighborhood and its people. Not what they hear from evening news reports. We're so much more than that. Any of the problems we DO face are ultimately institutional problems."}
])
