Message.create!([
  {conversation_id: 78, text: "Hey Darnell, saw your post about the cookout. Sounds like a great idea! Would love to help organize it if you need a hand with anything.", user_id: 1},
  {conversation_id: 78, text: "What's up, Carl? Yeah, any input/help is more than welcome!", user_id: 26},
  {conversation_id: 78, text: "You have any lawn chairs or anything like that?", user_id: 26},
  {conversation_id: 78, text: "Cool. Yeah, I have three or four I could bring! Let me know if you want me to pick anything else up from the store (plates, napkins, burger buns, etc.).", user_id: 1},
  {conversation_id: 78, text: "For sure. I'll let you know! Thanks for reaching out—glad people seem to be into the idea.", user_id: 26},
  {conversation_id: 79, text: "Dude. Can we just talk about Superkhana for a second?", user_id: 1},
  {conversation_id: 79, text: "Isn't it so good?", user_id: 2},
  {conversation_id: 79, text: "A friend of a friend is the owner.", user_id: 2},
  {conversation_id: 79, text: "Nice. Does that mean you get free food?", user_id: 1},
  {conversation_id: 79, text: "Haha, I wish.", user_id: 2},
  {conversation_id: 79, text: "Can't wait for this pandemic to be over so I can eat there every day.", user_id: 2},
  {conversation_id: 80, text: "Yo, is that a cello in your profile pic?", user_id: 1},
  {conversation_id: 80, text: "It is indeed! Do you play, or are you just a fan?", user_id: 33},
  {conversation_id: 80, text: "I play a couple other instruments mediocre-ly, but I absolutely love the cello. Gorgeous instrument.", user_id: 1},
  {conversation_id: 80, text: "How long have you been playing?", user_id: 1},
  {conversation_id: 80, text: "Pretty much since middle school. Had a band teacher who saw my interest and actually lent me a cello on weekends.", user_id: 33},
  {conversation_id: 81, text: "Hi Patty! Saw your post about The South Side. Just read it last year and really enjoyed it. Did you have any favorite sections/chapters?", user_id: 1},
  {conversation_id: 82, text: "I heard that march go by as well the other night. Was pretty cool to hear it all the way down the block!", user_id: 1},
  {conversation_id: 82, text: "Agreed. Are you on Central Park as well?", user_id: 28},
  {conversation_id: 82, text: "Yeah, I'm right around Central Park and Diversey. You?", user_id: 1},
  {conversation_id: 82, text: "Right down the street! Closer to Fullerton.", user_id: 28},
  {conversation_id: 83, text: "Fancy seeing you on here, Carl :)", user_id: 30},
  {conversation_id: 83, text: "Haha, hey Lori. What if I just texted you back or messaged you on IG every time you messaged me on here (so that it looked like a one-sided conversation)?", user_id: 1},
  {conversation_id: 83, text: "Looks like you just gave away a brilliant plan.", user_id: 30},
  {conversation_id: 83, text: "Lolol...", user_id: 1},
  {conversation_id: 84, text: "Hey Carl, I think we've met before no? Unless I'm thinking of another Carl with a C who looks just like you.", user_id: 4},
  {conversation_id: 84, text: "I think you're right! Becky's Jewbilee party last year?", user_id: 1},
  {conversation_id: 84, text: "You're the one who published that card game, right?", user_id: 1},
  {conversation_id: 84, text: "Yup, spot on!", user_id: 4},
  {conversation_id: 84, text: "I'd love to play it sometime. And actually, I'd love to pick your brain on the subject sometime.", user_id: 1},
  {conversation_id: 84, text: "You interested in getting into developing games? (Or maybe you're already developing something?)", user_id: 4},
  {conversation_id: 85, text: "Hey Mary, you used to teach at NEIU, right?", user_id: 1},
  {conversation_id: 85, text: "Yes, I did! Are/were you a student there?", user_id: 31},
  {conversation_id: 85, text: "I finished an MA in English a couple years back. Never had a class taught by you, but I did see you present a paper at a conference four or five years ago.", user_id: 1},
  {conversation_id: 85, text: "Sounds about right. Remember what the paper/conference was about?", user_id: 31},
  {conversation_id: 86, text: "Nice to meet you, Carl. You going to that BBQ that Darnell is putting together?", user_id: 13},
  {conversation_id: 87, text: "Hey Merita. Strange question. Do you happen to have a poodle? Because you look just like someone who always walks by with a poodle. (And I probably wouldn't remember anyone who walked by with a dog unless that dog was a well-manicured poodle.)", user_id: 1},
  {conversation_id: 87, text: "Hahaha, that's me. Guilty as charged.", user_id: 29},
  {conversation_id: 87, text: "Do you own a dog?", user_id: 29},
  {conversation_id: 87, text: "Nope. Just a cat. Maybe when I'm like 50 and living somewhere with a backyard I'll get a dog.", user_id: 1},
  {conversation_id: 87, text: "So true about the back yard thing...", user_id: 29}
])
Post.create!([
  {block_pair_id: 1, user_id: 26, text: "Anyone up for doing a get-to-know-you cookout in a few weekends? I can do the grilling and everyone else can bring a dish to share. I'm thinking a Saturday (either the 22nd or 29th).\n\nLet me know if you're interested, and if we end up settling on a date/time, I can DM you my address.", image_url: ""},
  {block_pair_id: 1, user_id: 3, text: "Finally got around to reading WBEZ reporter Natalie Moore's book, and thought it was really good. Was wondering if any of you had other recommendations.\n\nP.S. - And if your recommendations are good, I'm also secretly wondering if some of you might want to start a block club book club...?", image_url: "data:image/jpeg;base64,"},
  {block_pair_id: 1, user_id: 13, text: "Kinda curious... What drew y'all to this site? What are you hoping to learn or get out of it?", image_url: ""},
  {block_pair_id: 1, user_id: 28, text: "Anyone here go to the Black Abolitionist Network's protest outside Lori's house on Wednesday night? Didn't even know about it until I heard them marching by my apartment on their way there. Would love to know about future marches/rallies if anyone knows of any coming up!", image_url: "https://pbs.twimg.com/media/EenzibTWkAAE69S.jpg"},
  {block_pair_id: 1, user_id: 2, text: "What are your favorite restaurants in your neighborhood, and why? I'll start with a couple of my favorite Logan Square restaurants...\n-El Habanero: tiny, family-run Mexican joint that makes consistently good food.\n-Superkhana International: they have a butter chicken calzone for goodness sakes. I mean, just LOOK at that thing.", image_url: "https://images.squarespace-cdn.com/content/v1/5585c483e4b0573923c26f67/1574216746438-WT93OMMXG6WF9LR4T9I6/ke17ZwdGBToddI8pDm48kG87Sfbgg29A4BYEDq3OXvgUqsxRUqqbr1mOJYKfIPR7LoDQ9mXPOjoJoqy81S2I8N_N4V1vUb5AoIIIbLZhVYxCRW4BPu10St3TBAUQYVKcf4OxbJOyh_wHUnyc4kQLQ6SBshRGOku7c30Y_IRDNPta8R2IY5BHMaEj1zOWoDTZ/image-asset.jpeg"}
])
