  {email: "carl@gmail.com", password_digest: "$2a$12$n1NxG.NZpemlKQ5SgYtW1.AR0AW7efYU9bg0QxWCk3oyMv/KyZXIG", first_name: "Carl", last_name: "Hauck", street_num: 2737, street_direction: "N", street: "Central Park Ave", zip_code: "60647", block_id: 1, image_url: "https://lh4.googleusercontent.com/-XZUgJ66mJ6c/AAAAAAAAAAI/AAAAAAAAAjg/7Y4nvM1Yvh4/photo.jpg", how_i_got_here: "I moved from the Portage Park/Jefferson Park area to Logan Square in 2018. My partner and I had always liked the area, and she was already living in a different apartment in Logan at the time.", what_i_like: "This particular corner of Logan (near Avondale) still has a lot of older homes and small apartment buildings (not many new, garish condo developments), which gives it a quieter, family-friendly community vibe. There are still plenty of \"hip\" places nearby too (restaurants and bars and such). Plus, I'm within walking distance of the Blue Line, two grocery stores (a bigger one and a local food co-op), and a couple parks.", what_i_would_change: "Aside from the larger Logan Square neighborhood aldermen allowing too many trendy condo construction projects, I honestly can't think of much around my immediate area that I'd want to change. That feels strange to say, though, since I think it's pretty clear that the city has a lot of work to do to ensure that all neighborhoods (schools and parks included) receive resources and investment equitably.", birthday: "1987-08-12"},
